import React from 'React';

export class SVGFrame extends React.Component {
	render() {
		return(
			<svg
			    width={width}
			    style={style}
			    height={height}
			    className={className}
			    xmlns="http://www.w3.org/2000/svg"
			    viewBox={viewBox || getViewBox(name)}
			    xmlnsXlink="http://www.w3.org/1999/xlink"
			  >
			    // {getPath(name, { fill })}
			  </svg>
		)
	}
}
